    {src: student, title: 'Research paper', toRoute: '/s/addStudeent',category:'project'},
    {src: teacher2, title: 'Allocate Guide', toRoute: '/s/addStudeent',category:'guide'},
    {src: teacher, title: 'Allocate Reviewer', toRoute: '/s/addStudeent',category:'reveiwer'},
    {src: teacher, title: 'Project under ', toRoute: '/s/addStudeent',category:'guide'}
  ]
export default homeData;
